import { motion } from 'framer-motion'
import { pageAnimation, titleAnim } from '../animation'

const ContactUs = () => {
  return (
    <motion.div
      exit="exit"
      variants={pageAnimation}
      initial="hidden"
      animate="show"
      style={{ background: '#fff' }}
    >
      <h1>Our Contact</h1>
    </motion.div>
  )
}

export default ContactUs
